import React from "react";


function Card( ){
    return(
        <>
        <div className="card">
            <img src="https://media.istockphoto.com/id/517188688/photo/mountain-landscape.jpg?s=1024x1024&w=0&k=20&c=z8_rWaI8x4zApNEEG9DnWlGXyDIXe-OmsAyQ5fGPVV8=" alt="img1"></img>
            <h2>Photo 1</h2>
        </div>
        </>
    )
}
export default Card;
